import { StatusBar } from 'expo-status-bar';
import React, { Component } from 'react';
import { StyleSheet, Text, View, Image, TouchableWithoutFeedback, TextInput, SafeAreaView, keyboard, TouchableOpacity, KeyboardAvoidingView } from 'react-native';

export default function Login() {
  return (
    <SafeAreaView style={styles.container}>
     <StatusBar barStyle="light-content"/>
     <KeyboardAvoidingView behabior='padding' style={styles.container}>

            <View style={styles.container}>
      <View style={styles.logoContainer}>
          <Image source={require('../assets/logo2.png')} style={styles.logo}>
            </Image>
              <Text style={styles.title} >

               </Text>
      </View>
      <View>
              <View style={styles.infoContainer}>
                <TextInput style={styles.input}
                  placeholder="Enter Email "
                  placeholderTextColor="black"
                  keyboardType="email-address"
                  returnKeyType="next"
                  autoCorrect={false}
                />
                <TextInput style={styles.input}
                  placeholder="Enter Password "
                  placeholderTextColor="black"
                  returnKeyType="go"
                  secureTextEntry
                  autoCorrect={false}
                />
                <TouchableOpacity style={styles.buttonContainer}>
                    <Text style={styles.buttonText}>SIGN IN</Text>
                </TouchableOpacity>
              </View>
            </View>
    </View>

     </KeyboardAvoidingView>
    </SafeAreaView>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#000220',
    flexDirection: 'column',
  },
  logoContainer: {
    flex: 1,
    alignItems: 'center',
    justifyContent: 'center',
  },
  logo:{
    width: 200,
    height: 76,
  },
  title:{
    color: 'white',
    fontSize: 20,
    textAlign: 'center',
    marginTop: 15,
    opacity: 0.9,
  },
  infoContainer:{
    position: 'absolute',
    left: 0,
    right: 0,
    bottom: 0,
    height: 200,
    padding: 20,
  },
  input: {
    borderRadius: 25,
    backgroundColor: 'white',
    color: 'black',
    marginBottom:10,
    paddingHorizontal: 15,
    paddingVertical: 10
  },
  buttonContainer:{
    backgroundColor: '#3C99DC',
    paddingVertical: 15,
    borderRadius: 25,
  },
  buttonText:{
    textAlign: 'center',
    color: 'blue',
    fontSize: 18,
    fontWeight: 'bold',
  }
});
